val similarityDistribution = udf(
    // Fitted Beta Distribution for dot product between read articles and user profiles
    //  val dist = new BetaDistribution(1.623769, 2.284589)
    //  x: Double => dist.cumulativeProbability(x)*/
    // Polynomial approximate of the above Beta distribution
    (x: Double) => {
      var xpow = x
      var cum = 5.351427e-04
      cum += -1.217876e-01 * xpow
      xpow *= x
      cum += 7.663958e+00 * xpow
      xpow *= x
      cum += -1.400156e+01 * xpow
      xpow *= x
      cum += 1.045934e+01 * xpow
      xpow *= x
      cum += -3.007094e+00 * xpow

      cum
    })

import com.sanoma.dsnl.scala_misc.math.SparseVector
 val dotProduct = (thisVector: SparseVector, that: SparseVector) => {
   var i = 0
   var j = 0
   var sum: Double = 0
   while (i < thisVector.indices.length && j < that.indices.length) {
     if (thisVector.indices(i) < that.indices(j)) {
       i += 1
     } else if (thisVector.indices(i) > that.indices(j)) {
       j += 1
     } else {
       sum += thisVector.values(i) * that.values(j)
       i += 1
       j += 1
     }
   }
   sum
 }
